                    </div>
                    <button className="CSS_Challenges_left_btn" onClick={handleClick} >
                        Explore <span>&#10148;</span>
                        <NavLink />
                    </button>
                </div>
                <div className="CSS_Challenges_right">
                    <img src={svg2} alt="" />
                </div>
            </div>
        </div>
    )
}

export default CSS_Challenges ;
